// Handle earth science requests
const input = $input.item.json;
const integration = input.routing_node;
const action = input.action;
const params = input.params || {};

let result = null;
let error = null;

try {
  switch(integration) {
    case 'usgs_earthquake':
      result = { source: 'USGS Earthquake', url: 'https://earthquake.usgs.gov/fdsnws/event/1', action, note: 'Global earthquake data' };
      break;
    case 'noaa_tides':
      result = { source: 'NOAA Tides & Currents', url: 'https://api.tidesandcurrents.noaa.gov/api/prod', action, note: 'Tide predictions and observations' };
      break;
    case 'ndbc_buoy':
      result = { source: 'NDBC Buoys', url: 'https://www.ndbc.noaa.gov/data', action, note: 'Marine weather buoy data' };
      break;
    case 'usace_water':
      result = { source: 'USACE Water Management', url: 'https://water.usace.army.mil/a2w', action, note: 'Dam and reservoir data' };
      break;
    case 'nws_flood':
      result = { source: 'NWS Flood', url: 'https://water.weather.gov/ahps', action, note: 'Flood forecasting data' };
      break;
    case 'usgs_water':
      result = { source: 'USGS Water Services', url: 'https://waterservices.usgs.gov/nwis', action, note: 'Streamflow and groundwater data' };
      break;
    case 'iris_seismic':
      result = { source: 'IRIS Seismic', url: 'https://service.iris.edu', action, note: 'Seismic waveform data' };
      break;
    case 'noaa_tsunami':
      result = { source: 'NOAA Tsunami Warning', url: 'https://www.tsunami.gov', action, note: 'Tsunami alerts and data' };
      break;
    default:
      error = `Unknown earth science integration: ${integration}`;
  }
} catch(e) {
  error = e.message;
}

return [{
  json: {
    success: !error,
    request_id: input.request_id,
    integration: integration,
    category: 'earth_science',
    action: action,
    data: result,
    error: error,
    timestamp: new Date().toISOString()
  }
}];
